import React from "react";
import { BrowserRouter as Router, Link, Switch } from "react-router-dom";

const Navbar = () => {
  return (
    <Router>
      <Switch>
        <nav>
          <ul>
            <li>
              <a href="/">Home</a>
            </li>
            <li>
              <a href="/about">About</a>
            </li>
            <li>
              <Link to="/articles">Articles</Link>
            </li>
            <li>
              <Link to="/articles-all">All articles</Link>
            </li>
          </ul>
        </nav>
      </Switch>
    </Router>
  );
};
export default Navbar;
